#!/usr/bin/python

import numpy as NP
from matplotlib import pyplot as PLT
from matplotlib import cm as CM
from matplotlib import axes
import random

graph = 2.1
xfontsize = 60
yfontsize = 60
xlabelsize = 70
ylabelsize = 70



