    def dictFindSTD(d, key, near = 0.003):
        keylist = d.keys()
        
        ele = []
        for i in range(len(keylist)):
            temp = np.abs(keylist[i] - key)
            if temp *1.0 / (key + 0.00001) < near:
                ele.append(d.get(keylist[i]))
        if len(ele) < 1:
            return -1
            
        
        return np.std(ele)
        
