    #find a KEY of element in d which is the most similar as key, output the standard deviation of all elements
    #near: the difference against the key 
    def dictFindRange(d, key, near = 0.003):
        keylist = d.keys()
        
        ele = []
        for i in range(len(keylist)):
            temp = np.abs(keylist[i] - key)
            if temp *1.0 / (key + 0.00001) < near:
                ele.append(d.get(keylist[i]))
        if len(ele) < 1:
            return -1
            
        
        return np.max(ele) - np.min(ele)
        
